*/
import React, { Component } from 'react';
import axios from 'axios';
import { Container, Row, Col, Table } from 'react-bootstrap';

import Card from 'components/Card/Card.jsx';
import { thArray, tdArray } from 'variables/Variables.jsx';

class TableList extends Component {
	constructor(props) {
		super(props);
		this.state = {
			reco: []
		};
	}

	componentDidMount() {
		this.getData();
	}

	baseUrl(route) {
		return `http://35.247.147.177:4000/api/v1/${route}`;
	}

	getData() {
		return axios.get(this.baseUrl('data')).then((response) => {
			console.log(response.data);
			this.setState({ reco: response.data });
		});
	}

	render() {
		const { reco } = this.state;

		return (
			<div className="content">
				<Container fluid>
					<Row>
						<Col md={12}>
							<Card
								title="People Who Use Face Recognitions"
								category="Here is the data"
								ctTableFullWidth
								ctTableResponsive
								content={
									<Table striped hover>
										<thead>
											<tr>
												<th>NO</th>
												<th>NAME</th>
												<th>NIP</th>
												<th>START</th>
												<th>END</th>
												<th>TIME LAPSE</th>
												<th>DISTANCE</th>
												<th>PERCENTAGE</th>
												<th>NOTES</th>
											</tr>
										</thead>
										<tbody key={1}>
											{reco.map((prop, key) => (
												<tr key={'x'}>
													<td key={key + 1}>{key + 1}</td>
													<td key={key + 2}>{prop.recoName}</td>
													<td key={key + 3}>{prop.recoNip}</td>
													<td key={key + 4}>{prop.recoStart}</td>
													<td key={key + 5}>{prop.recoEnd}</td>
													<td key={key + 6}>{prop.recoTimeLapse}</td>
													<td key={key + 7}>
														{prop.recoDistance.toFixed(2)}
													</td>
													<td key={key + 2}>{prop.recoPercentage}</td>
													<td key={key + 2}>{prop.recoNotes}</td>
												</tr>
											))}
										</tbody>
									</Table>
								}
							/>
						</Col>
					</Row>
				</Container>
			</div>
		);
	}
}

export default TableList;
